import React from 'react';
import './Header.scss';
import logo from '../assets/logo.png';
const Header = () => {
    return(
        <div id='header-container'>
            <div id="inner-header">
                <div id='logo'>
                    <img src={logo} alt="icon" />
                </div>
                <div id='menu-item'>

                </div>
            </div>
        </div>
    )
}

export default Header;
